import React from 'react'
import '../CSS/main.css'
import {observer} from 'mobx-react-lite'

function Assests({store}) {
    return (
        <>
        <div class = "example">
            <button onClick = {() =>store.getAssestsData()}>Show Data</button>
        </div>
        </>
    )
}

export default  observer(Assests);
